import React from 'react';
import './style.css';
import down from '../../assets/imagens/down-arrow.png';

import Pageheader from '../../Componentes/Pageheader';


export default function Inicio(){
    return(
        <div>
            <Pageheader/>
            <div id="fundoP" className="container py-5">
                  <div className="d-flex justify-content-center" id="foto">
                        <img id="perfil" className="img-fluid" src="https://avatars3.githubusercontent.com/u/62311509?s=460&u=49d3488c7088800a4a4866353fbd68064de814a8&v=4" alt="t"></img>
                  </div>
                  <ul>
                      <li><img  className="img-fluid" src={down} alt="t"></img></li>
                      <li><img  className="img-fluid" src={down} alt="t"></img></li>
                      <li><img  className="img-fluid" src={down} alt="t"></img></li>
                      <li><img  className="img-fluid" src={down} alt="t"></img></li>
                  </ul>

            </div>
        </div>

    );
}
